import Header from "../components/Header.js";
export default class Projects extends React.Component {
  constructor() {
    super();
    this.state = {}
  }
  componentDidMount() {
    console.log("ieuthsi");
  }
  render() {
    return(
      <div class="container">
      <Header/>
        <div class="homeImg">
            <div class="homeDiv center">
                <h1 class="titleMain">DEVON CRAWFORD</h1>
                <h3>an electronics hobbyist passionate for innovative technology and digital content</h3>
            </div>
            <div class="homeSouth">
                <h4><a class="stealthLink subPmin padX0" href="#">Read More</a></h4>
                <button class="smoothScrollBtn" type="button"><img src="/images/Down-Arrow-White.png" width="30"/></button>
            </div>
        </div>
        <div className="hench">
          <h1>Work</h1>
        </div>
        <style jsx>{`.hench {
          background-image : url("https://instagram.fbom3-1.fna.fbcdn.net/vp/3327f6a555ab2e5af274efa8223912fe/5D979209/t51.2885-15/sh0.08/e35/s750x750/50717724_2051558481599094_8552240087813895815_n.jpg?_nc_ht=instagram.fbom3-1.fna.fbcdn.net");
          background-size : cover;
          background-position : center;
          height: 100vh;
        }`}</style>
      </div>

    );
  }
}
